query:
mutation groupsDeleteGroup ( $groupMembersListInput:GroupMembersListInput! $groupRefInput:GroupRefInput! $accountId:ID! ) {
	groups ( accountId:$accountId ) {
		deleteGroup ( input:$groupRefInput  )  {
			groupDeleteGroupPayload: group {
				id 
				name 
				description 
				audit  {
					updatedTime
					updatedByAuditingMetadata: updatedBy {
						id 
						name 
						... on AdminRef {
							id 
							name 
						}
						... on ApiKeyRef {
							id 
							name 
						}
					}
				}

				members ( input:$groupMembersListInput  )  {
					itemsGroupMembersListPayload: items {
						id 
						name 
						type 
					}
					pagingGroupMembersListPayload: paging {
						total 
					}
				}

				membersCount 
				membersCountPerType  {
					typeGroupMemberTypeCount: type
					membersCount
				}

			}
		}

	}	
}
